【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ ピクサスの美しさを支える「キヤノン純正インク」<br />キヤノン純正のインクは、キヤノンインクジェットプリンター専用に開発されています。より美しく、より長くプリントを楽しんでほしい。キヤノンでは、ピクサスの性能を引き出すために純正インクを開発し、絶えずその性能を高めてきました。プリンターの性能を維持し、安定して使用いただくため、キヤノン純正インクをぜひご使用ください。<br /><br />★ メリハリのあるダイナミックなフォトプリントを再現<br />キヤノン純正「染料ブラックインク」は、複数種類の染料を混合することで、色調をニュートラルに近づけ、視覚的な黒さを高めます。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* カラー：顔料ブラック、ブラック、シアン、マゼンタ、イエロー、グレー<br />* 対応機種：PIXUS MG7530F、PIXUS MG7530、PIXUS MG7130、PIXUS MG6730、PIXUS MG6530、PIXUS MG6330、PIXUS iP8730</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
